import React from 'react';
import './MainPage.css'; // Create a CSS file for styling
import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import NavDropdown from 'react-bootstrap/NavDropdown';

function MainPage() {
//   return (
//     <div className="MainPage-page">
//       <header className="MainPage-navbar">
//         <a href="/data_table">Data Table</a>
//         <a href="/MusicVisualiser">MusicVisualiser</a>


//       </header>
//       <div className="MainPage-content">
//         <h1>Welcome to MainPage</h1>
//       </div>
//     </div>
//   );
// }
return (
  <Navbar expand="lg" className="bg-body-tertiary">
    <Container>
      <Navbar.Brand href="#home">Musical-Stairs</Navbar.Brand>
      <Navbar.Toggle aria-controls="basic-navbar-nav" />
      <Navbar.Collapse id="basic-navbar-nav">
        <Nav className="me-auto">
          <Nav.Link href="/data_table">Data Table</Nav.Link>
          <Nav.Link href="/MusicVisualiser">Music Visualiser</Nav.Link>
          <NavDropdown title="Dropdown" id="basic-nav-dropdown">
            <NavDropdown.Item href="#action/3.1">Action</NavDropdown.Item>
            <NavDropdown.Item href="#action/3.2">
              Another action
            </NavDropdown.Item>
            <NavDropdown.Item href="#action/3.3">Something</NavDropdown.Item>
            <NavDropdown.Divider />
            <NavDropdown.Item href="#action/3.4">
              Separated link
            </NavDropdown.Item>
          </NavDropdown>
        </Nav>
      </Navbar.Collapse>
    </Container>
  </Navbar>
);
}

export default MainPage;
